import React from "react";
import {
    StyleSheet, 
    View,
} from  "react-native";
import {
    withTheme,
    ProgressBar,
    Title,
    IconButton
} from "react-native-paper";

function UnlockPremium(props) {
    const {theme} = props;
    return (
        <View style={styles.container}>
            <Title>Converting Audio ...</Title>
            <ProgressBar></ProgressBar>
            <IconButton
                icon={"Cancel"}
                size={80}
                color={theme.colors.primary}
                onPress={isRecording ? this.stopRecording : this.startRecording}
                animated
            />
        </View>
    );
}

const styles = StyleSheet.create({
    container: { 
        backgroundColor: "#121212",
        paddingTop: 16,
        paddingBottom: 16,
        paddingLeft: 16,
        paddingRight: 16,
        flex: 1,
    },
});

export default withTheme(UnlockPremium);
